import { Component, OnInit } from '@angular/core';

import { LoginService } from './service/login.service';
import { Ilogin } from 'src/app/interfaces/Ilogin';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { Router } from '@angular/router';
import { min } from 'rxjs';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.scss']
})
export class LoginComponent implements OnInit {

  public form!: FormGroup;

  constructor(
    private $loginService: LoginService,
    private formBuilder: FormBuilder,
    private router: Router
  ) { }

  ngOnInit(): void {
    this.createForm();
  }

  createForm() {
    this.form = this.formBuilder.group({
      email: ['', [Validators.required], ],
      password: ['', [Validators.required, Validators.minLength(3)]]
    });
  }

  doLogin() {
    this.$loginService.getLogins().subscribe(
      (response: Array<Ilogin>) => {
        this.findingByUser(response);
      },
      (error) => {
        console.error('Error fetching logins:', error);
        alert('An error occurred while logging in. Please try again later.');
      }
    );
  }

  findingByUser(response: Array<Ilogin>) {
    const user = response.find(u => u.email === this.form.value.email && u.password === this.form.value.password);
    if (user) {
      this.loggingUser(user);
    } else {
      alert('User not found!');
    }
  }

  loggingUser(user: Ilogin) {
    localStorage.setItem('login', user.email);
    this.form.reset();
    alert('WOWWW! User Found!');
    this.router.navigate(['dashboard']);
  }
}

  <div class="sm:mx-auto sm:w-full sm:max-w-sm mt-10">
    <h2 class="text-center text-2xl font-bold text-gray-900">
      Login into account
    </h2>
  </div>

  <div class="mt-5 sm:mx-auto sm:w-full sm:max-w-sm">
    <mat-card>
      <mat-card-content>
        <form [formGroup]="form">
          <mat-form-field>
            <input matInput placeholder="E-mail" id="email" formControlName="email" type="text">
            <mat-error
              *ngIf="(form.controls.email.dirty)
              && form.controls.email.hasError('required')">
              The field shouldn't be empty!
            </mat-error>
            <mat-error
              *ngIf="(form.controls.email.dirty)
              && form.controls.email.hasError('pattern')">
              Provide a valid e-mail!
            </mat-error>
          </mat-form-field>
          <mat-form-field>
            <input matInput type="password" placeholder="Password" id="password" formControlName="password" type="password">
            <mat-error
              *ngIf="(form.controls.password.dirty)
              && form.controls.password.hasError('required')">
              The field shouldn't be empty!
            </mat-error>
            <mat-error
              *ngIf="(form.controls.password.dirty)
              && form.controls.password.hasError('minlength')">
              The min of characters is 3!
            </mat-error>
          </mat-form-field>
          <button
            mat-raised-button
            color="primary"
            [disabled]="!form.valid"
            (click)="doLogin()"
            >Login</button>
        </form>
      </mat-card-content>
    </mat-card>
  </div>
